import styled from 'styled-components'

export default function Login() {
  return (
    <Container className="container-sm">
      <AuthCard>
				<Title>Login</Title>
				<div class="input-group mb-3 w-100">
					<span class="input-group-text" id="basic-addon1">@</span>
					<button type="submit" class="btn btn-primary">Login with Google</button>
				</div>
				<Divider className="hr-label">
					<span>Or</span>
				</Divider>
				<form>
					<div class="input-group mb-3">
						<input type="text" class="form-control" placeholder="Email" maxLength={30} aria-label="Email" aria-describedby="basic-addon1" required/>
					</div>
					<div class="input-group mb-3">
						<input type="password" class="form-control" placeholder="Password" maxLength={30} aria-label="Password" aria-describedby="basic-addon1" required/>
					</div>
					<div class="btn-group" role="group" aria-label="Basic example">
						<button type="submit" class="btn btn-primary">Submit</button>
					</div>
				</form>
			</AuthCard>
    </Container>
  )
}

const Container = styled.div`
	height: 100vh;
	display: flex;
	align-items: center;
	justify-content: center;
`;

const AuthCard = styled.div`
	width: 400px;
	height: 500px;
	padding: 20px 50px;
	border-radius: 8px;
	background-color: #FFF;
	box-shadow: 10px 10px 45px #EAEAEA;
`;

const Title = styled.p`
	font-size: 24px;
	font-weight: 500;
	font-family: 'Work Sans',
`;

const Divider = styled.div`
	clear: both;
	display: flex;
	margin-top: 20px;
	overflow: hidden;
	position: relative;
	text-align: center;
	align-items: center;
	margin-bottom: 20px;
	justify-content: center;
`
